Once upon a time there was a magical world known as Wizard Land, where witches, wizards, fairies and fairytale creatures dwelled. Sometimes they lived together in peace, sometimes there were local conflicts, but no conflict could compare to the Last Battle of Wizard Land! Use your Match 3 skills to explore this exciting world and resurrect the inhabitants! With a variety of obstacles, bonuses, and extra tasks, Wizard Land is fun for everyone!

* Fast-paced gameplay
* Multiple game modes
* Save Wizard Land!




System Requirements:

* OS: Windows XP/Vista
* CPU: 1.0 GHz
* RAM: 512 MB
* DirectX: 9.0
* Hard Drive: 36 MB
